import './App.css';
import ProfilePage from './pages/profile/profile-page';
import SignIn from './pages/login/login.page';
import { Route, Routes} from 'react-router-dom'
function App() {
  return (
    <div className="App">
            <div>
            <SignIn/>
            <Routes>
               <Route  path='/' element={ProfilePage} />
               <Route path='/' element={<h1>nothing</h1>} />
            </Routes>
         </div>
    </div>
  );
}

export default App;
